import React, { Component } from 'react';


class Header extends Component {

    clickHandler = (e) => {
        e.preventDefault();
    }

    render () {
        return (
            <header className="header">
                <div className="logo__container">
                    <img className ="logo" src={this.props.logo} alt="Brainflix Logo"/>
                </div>
                <form>
                    <button type="submit" onClick={e => this.clickHandler(e)}></button>
                    <input type="text" placeholder="Search"/>
                </form>
            </header>
        );
    }
}

export default Header;
